import React, { Fragment } from "react"
import Moment from 'moment';

const Details = props => {
    let content = "Please select a file from the list";
    if(props.DetailsFile)

    return (
        <Fragment>
            {!props.DetailsFile && (
                <div>
                    <h3>Details</h3>
                    <hr />
                    <div className="text-center">
                        <h4 className="text-secondary">{props.DetailsFile.title}</h4>
                        <p className="small fw-light">{Moment(props.DetailsFile.uploadDate).format('dddd - DD MMMM yyyy')}</p>
                    </div>
                    <hr />
                    <div className="text-center">
                        <h5>Main file</h5>
                        {props.DetailsFile.file}
                    </div>
                </div>
            )}

        </Fragment>
    )
}
export default Details;
